        protected int TestNumber { get; set; }

        public BaseEGTSlotGame()
        {
            ReceiveAsync<PerformanceTestRequest>(OnPerformanceTest);
            TestNumber = 0;
        }
        protected virtual async Task OnPerformanceTest(PerformanceTestRequest _)
        {
            try
            {
                var stopWatch = new Stopwatch();
                stopWatch.Start();
                double sumOdd1 = 0.0;
                BaseClasses.BaseEGTSlotBetInfo betInfo = new BaseClasses.BaseEGTSlotBetInfo();
                betInfo.MoreBet = -1;
                for (int i = 0; i < 100000; i++)
                {
                    BasePPSlotSpinData spinData = await SelectRandomStop(0, betInfo);
                    sumOdd1 += spinData.SpinOdd;
                }
                stopWatch.Stop();
                long elapsed1 = stopWatch.ElapsedMilliseconds;

                _logger.Info("{0} Performance Test Results:  \r\nPayrate: {3}%, {1}s, {2}%", this.GameName,
                    Math.Round((double)elapsed1 / 1000.0, 3), Math.Round(sumOdd1 / 1000, 3),
                    _config.PayoutRate);
                Sender.Tell(true);
            }
            catch (Exception ex)
            {
                _logger.Error("Exception has been occurred in BaseEGTSlotGame::onPerformanceTest {0}", ex);
                Sender.Tell(false);
            }
        }

        protected override void LoadSetting()
        {
            base.LoadSetting();
            InitGameData();
        }
        protected virtual void InitGameData()
        {
        }
        protected override async Task OnLoadSpinData(BsonDocument infoDocument)
        {
            try
            {
                _spinDataDefaultBet = infoDocument["defaultbet"].AsDouble;
                _emptySpinCount = infoDocument["emptycount"].AsInt32;
                _totalSpinCount = infoDocument["totalcount"].AsInt32;
            }
            catch (Exception ex)
            {
                _logger.Error("Exception has been occured in loading spin data of game {0} {1}", GameName, ex);
            }
        }

        #region MessageProc
        protected override async Task OnProcMessage(string strUserID, int websiteID, GITMessage message, double userBalance, Currencies currency)
        {
            try
            {
                if((CSMSG_CODE)message.MsgCode == CSMSG_CODE.CS_EGT_JACKPOTSTATE)
                {
                    await OnJackpotState(websiteID, currency);
                    return;
                }

                string strGlobalUserID = string.Format("{0}_{1}", websiteID, strUserID);
                string sessionKey = message.Pop().ToString();
                string messageId = message.Pop().ToString();

                switch ((CSMSG_CODE)message.MsgCode)
                {
                    case CSMSG_CODE.CS_EGT_DOINIT:
                        OnDoInit(strGlobalUserID, message, userBalance, currency, sessionKey, messageId);
                        break;
                    case CSMSG_CODE.CS_EGT_SUBSCRIBE:
                        OnSubscribe(strGlobalUserID, message, userBalance, currency, sessionKey, messageId, websiteID);
                        break;
                    case CSMSG_CODE.CS_EGT_SETTINGS:
                        OnSettings(strGlobalUserID, message, userBalance, currency, sessionKey, messageId);
                        break;
                    case CSMSG_CODE.CS_EGT_DOSPIN:
                        await OnDoSpin(strUserID, websiteID, message, userBalance, currency, sessionKey, messageId);
                        break;
                    case CSMSG_CODE.CS_EGT_DOCOLLECT:
                        OnDoCollect(strGlobalUserID, message, userBalance, currency, sessionKey, messageId);
                        break;
                    case CSMSG_CODE.CS_EGT_DOGAMBLE:
                        await OnDoGamble(strUserID, websiteID, message, userBalance, sessionKey, messageId);
                        break;
                }
            } catch(Exception ex)
            {
            }
        }
        protected virtual void OnDoInit(string strGlobalUserID, GITMessage message, double balance, Currencies currency, string sessionKey, string messageId)
        {
            try
            {
                JObject loginResponse = JObject.Parse(LoginResponseString);
                loginResponse["balance"] = balance;
                loginResponse["currency"] = DicCurrencyInfo.Instance._currencyInfo[currency].CurrencyText;
                loginResponse["sessionKey"] = sessionKey;
                loginResponse["messageId"] = messageId;
                loginResponse["eventTimestamp"] = DateTimeOffset.UtcNow.ToUnixTimeMilliseconds();
                loginResponse["complex"] = JObject.Parse(LoginResponseComplexString);

                GITMessage resMessage = new GITMessage((ushort)SCMSG_CODE.SC_EGT_DOINIT);
                resMessage.Append(loginResponse.ToString());

                ToUserMessage toUserMessage = new ToUserMessage((int)_gameID, resMessage);

                Sender.Tell(toUserMessage, Self);
            }
            catch (Exception ex)
            {
                _logger.Error("Exception has been occurred in BaseEGTSlotGame::onDoInit GameID: {0}, {1}", _gameID, ex);
            }
        }

        protected virtual async void OnSubscribe(string strGlobalUserID, GITMessage message, double balance, Currencies currency, string sessionKey, string messageId, int websiteID)
        {
            try
            {
                JObject subscribeResponse = JObject.Parse(SubscribeResponseString);
                subscribeResponse["sessionKey"] = sessionKey;
                subscribeResponse["messageId"] = messageId;
                subscribeResponse["eventTimestamp"] = DateTimeOffset.UtcNow.ToUnixTimeMilliseconds();
                JObject jackpotStateResponse = await JackpotPoolConfig.Instance.PoolActor.Ask<JObject>(new GetJackpotState(websiteID, (GAMEID)_gameID));
                
                if (subscribeResponse["complex"] != null && subscribeResponse["complex"].Type == JTokenType.Object)
                {
                    var complex = (JObject)subscribeResponse["complex"];
                    if (complex["jackpotState"] != null && complex["jackpotState"].Type == JTokenType.Object)
                    {
                        var jackpotState = (JObject)complex["jackpotState"];
                        if (jackpotState["jackpotCards"] != null && jackpotState["jackpotCards"].Type == JTokenType.Object)
                        {
                            var jackpotCards = (JObject)jackpotState["jackpotCards"];
                            jackpotCards["levelI"] = jackpotStateResponse["currentLevelI"];
                            jackpotCards["winsLevelI"] = jackpotStateResponse["winsLevelI"];
                            jackpotCards["lastWinLevelI"] = jackpotStateResponse["lastWinLevelI"];
                            jackpotCards["lastWinDateLevelI"] = jackpotStateResponse["lastWinDateLevelI"];
                            jackpotCards["lastWinUserLevelI"] = jackpotStateResponse["lastWinUserLevelI"];
                            jackpotCards["largestWinLevelI"] = jackpotStateResponse["largestWinLevelI"];
                            jackpotCards["largestWinDateLevelI"] = jackpotStateResponse["largestWinDateLevelI"];
                            jackpotCards["largestWinUserLevelI"] = jackpotStateResponse["largestWinUserLevelI"];
                            jackpotCards["levelII"] = jackpotStateResponse["currentLevelII"];
                            jackpotCards["winsLevelII"] = jackpotStateResponse["winsLevelII"];
                            jackpotCards["lastWinLevelII"] = jackpotStateResponse["lastWinLevelII"];
                            jackpotCards["lastWinDateLevelII"] = jackpotStateResponse["lastWinDateLevelII"];
                            jackpotCards["lastWinUserLevelII"] = jackpotStateResponse["lastWinUserLevelII"];
                            jackpotCards["largestWinLevelII"] = jackpotStateResponse["largestWinLevelII"];
                            jackpotCards["largestWinDateLevelII"] = jackpotStateResponse["largestWinDateLevelII"];
                            jackpotCards["largestWinUserLevelII"] = jackpotStateResponse["largestWinUserLevelII"];
                            jackpotCards["levelIII"] = jackpotStateResponse["currentLevelIII"];
                            jackpotCards["winsLevelIII"] = jackpotStateResponse["winsLevelIII"];
                            jackpotCards["lastWinLevelIII"] = jackpotStateResponse["lastWinLevelIII"];
                            jackpotCards["lastWinDateLevelIII"] = jackpotStateResponse["lastWinDateLevelIII"];
                            jackpotCards["lastWinUserLevelIII"] = jackpotStateResponse["lastWinUserLevelIII"];
                            jackpotCards["largestWinLevelIII"] = jackpotStateResponse["largestWinLevelIII"];
                            jackpotCards["largestWinDateLevelIII"] = jackpotStateResponse["largestWinDateLevelIII"];
                            jackpotCards["largestWinUserLevelIII"] = jackpotStateResponse["largestWinUserLevelIII"];
                            jackpotCards["levelIV"] = jackpotStateResponse["currentLevelIV"];
                            jackpotCards["winsLevelIV"] = jackpotStateResponse["winsLevelIV"];
                            jackpotCards["lastWinLevelIV"] = jackpotStateResponse["lastWinLevelIV"];
                            jackpotCards["lastWinDateLevelIV"] = jackpotStateResponse["lastWinDateLevelIV"];
                            jackpotCards["lastWinUserLevelIV"] = jackpotStateResponse["lastWinUserLevelIV"];
                            jackpotCards["largestWinLevelIV"] = jackpotStateResponse["largestWinLevelIV"];
                            jackpotCards["largestWinDateLevelIV"] = jackpotStateResponse["largestWinDateLevelIV"];
                            jackpotCards["largestWinUserLevelIV"] = jackpotStateResponse["largestWinUserLevelIV"];
                            jackpotCards["screenName"] = jackpotStateResponse["lastWinUserLevelII"];
                            jackpotCards["winAmount"] = jackpotStateResponse["lastWinLevelII"];
                            jackpotCards["winLevel"] = 1;
                        }
                    }

                    BaseClasses.BaseEGTSlotBetInfo betInfo = null;
                    BaseClasses.BaseEGTSlotSpinResult spinResult = null;
                    if (_dicUserBetInfos.ContainsKey(strGlobalUserID))
                        betInfo = _dicUserBetInfos[strGlobalUserID];
                    if(_dicUserResultInfos.ContainsKey(strGlobalUserID))
                        spinResult = _dicUserResultInfos[strGlobalUserID];

                    if (betInfo != null && spinResult != null && complex["currentState"] != null && complex["currentState"].Type == JTokenType.Object)
                    {
                        var currentState = (JObject)complex["currentState"];
                        var historyJson = JObject.Parse(spinResult.ResultString);
                        currentState["state"] = historyJson["state"]?.ToString() ?? "";
                        currentState["winAmount"] = historyJson["winAmount"];
                        currentState["firstSpin"] = new JObject();
                        if (historyJson["complex"] != null && historyJson["complex"].Type == JTokenType.Object)
                        {
                            var historyComplexJson = (JObject)historyJson["complex"];

                            if (historyComplexJson["reels"] != null && historyComplexJson["lines"] != null)
                            {
                                foreach (var prop in historyComplexJson.Properties())
                                {
                                    if (prop.Name != "gameCommand")
                                    {
                                        currentState[prop.Name] = prop.Value;
                                        currentState["firstSpin"][prop.Name] = prop.Value;
                                    }
                                }
                            }
                            else
                            {
                                var historyFirstSpinJson = JObject.Parse(spinResult.FirstSpinString);
                                if (historyFirstSpinJson["complex"] != null && historyFirstSpinJson["complex"].Type == JTokenType.Object)
                                {
                                    var historyFirstSpinComplexJson = (JObject)historyFirstSpinJson["complex"];
                                    foreach (var prop in historyFirstSpinComplexJson.Properties())
                                    {
                                        if (prop.Name != "gameCommand")
                                        {
                                            currentState[prop.Name] = prop.Value;
                                            currentState["firstSpin"][prop.Name] = prop.Value;
                                        }
                                    }
                                }
                            }
                        }

                        currentState["gamblesUsed"] = (currentState["state"]?.ToString()??"") == "gamble" ? betInfo.GambleRound : 0;
                        currentState["gambles"] = (currentState["state"]?.ToString() ?? "") == "gamble" ? ((CheckGamblePossible(spinResult.TotalWin, betInfo.PlayBet, betInfo) && betInfo.GambleRound < 3) ? 3 - betInfo.GambleRound : 0) : 0;
                        currentState["freespinsUsed"] = betInfo.FreespinRoundUsed;
                        currentState["freespins"] = betInfo.FreespinTotalRound - betInfo.FreespinRoundUsed;
                        currentState["previousGambles"] = JToken.FromObject(betInfo.GambleCardHistory);
                        currentState["featureId"] = betInfo.FeatureId;
                        currentState["betMultiplier"] = betInfo.BetMultiplier;
                        currentState["bet"] = betInfo.PlayBet;
                    }
                }

                GITMessage resMessage = new GITMessage((ushort)SCMSG_CODE.SC_EGT_SUBSCRIBE);
                resMessage.Append(subscribeResponse.ToString());

                ToUserMessage toUserMessage = new ToUserMessage((int)_gameID, resMessage);

                Sender.Tell(toUserMessage, Self);
            }
            catch (Exception ex)
            {
                _logger.Error("Exception has been occurred in BaseEGTSlotGame::onDoInit GameID: {0}, {1}", _gameID, ex);
            }
        }

