        private long GetUnixMiliTimestamp()
        {
            DateTimeOffset now = DateTimeOffset.UtcNow;
            long unixTimeMilliseconds = now.ToUnixTimeMilliseconds();
            return unixTimeMilliseconds;
        }
        protected string CreateRoundID()
        {
            return string.Format("{0}", Guid.NewGuid().ToString().Replace("-", ""));
        }
        protected string CreateTransactionID()
        {
            return string.Format("{0}{1}", GetUnixMiliTimestamp(), Guid.NewGuid().ToString().Replace("-", ""));
        }
        protected virtual async Task OnDoSpin(string strUserID, int websiteID, GITMessage message, double userBalance, Currencies currency, string sessionKey, string messageId)
        {
            try
            {
                string strGlobalUserID = string.Format("{0}_{1}", websiteID, strUserID);

                bool isNewBet = true;
                if (_dicUserBetInfos.ContainsKey(strGlobalUserID) && _dicUserBetInfos[strGlobalUserID].HasRemainResponse)
                    isNewBet = false;

                if (message.MsgCode == (ushort)CSMSG_CODE.CS_EGT_DOSPIN)
                    ReadBetInfoFromMessage(message, strGlobalUserID, currency);

                await SpinGame(strUserID, websiteID, userBalance, isNewBet, sessionKey, messageId);
            }
            catch (Exception ex)
            {
                _logger.Error("Exception has been occurred in BaseEGTSlotGame::onDoSpin GameID: {0}, {1}", _gameID, ex);
            }
        }
        protected void OnDoCollect(string strGlobalUserID, GITMessage message, double balance, Currencies currency, string sessionKey, string messageId)
        {
            try
            {
                if (!_dicUserBetInfos.ContainsKey(strGlobalUserID))
                {
                    _logger.Error("{0} bet information has not been found in BaseEGTSlotGame::onDoCollect.", strGlobalUserID);
                    return;
                }
                BaseClasses.BaseEGTSlotBetInfo betInfo = _dicUserBetInfos[strGlobalUserID];

                if (!_dicUserResultInfos.ContainsKey(strGlobalUserID))
                {
                    _logger.Error("{0} result information has not been found in BaseEGTSlotGame::onDoCollect.", strGlobalUserID);
                    return;
                }

                BaseClasses.BaseEGTSlotSpinResult result = _dicUserResultInfos[strGlobalUserID];
                //if(!betInfo.HasRemainResponse)
                balance += result.TotalWin;

                _dicUserResultInfos[strGlobalUserID] = result;
                _dicUserLastBackupResultInfos[strGlobalUserID] = result;

                string strResponse = BuildCollectResMsgString(strGlobalUserID, balance, betInfo, result, EGTMessageType.Collect, sessionKey, messageId);
                GITMessage responseMessage = new GITMessage((ushort)SCMSG_CODE.SC_EGT_DOCOLLECT);
                responseMessage.Append(strResponse);

                if (result.TotalWin > 0.0)
                {
                    ToUserResultMessage toUserResult = new ToUserResultMessage((int)_gameID, responseMessage, 0.0, result.TotalWin, new GameLogInfo(GameName, "0", "Collect"), UserBetTypes.Normal);
                    toUserResult.BetTransactionID = betInfo.BetTransactionID;
                    toUserResult.RoundID = betInfo.RoundID;
                    toUserResult.TransactionID = CreateTransactionID();
                    toUserResult.RoundEnd = true;

                    var historyJson = JObject.Parse(result.ResultString);
                    historyJson["state"] = "idle";
                    result.ResultString = historyJson.ToString();

                    saveBetResultInfo(strGlobalUserID);
                    Sender.Tell(toUserResult);

                    result.TotalWin = 0.0;
                    return;
                }

                Sender.Tell(new ToUserMessage((ushort)_gameID, responseMessage));
            }
            catch (Exception ex)
            {
                _logger.Error("Exception has been occurred in BaseEGTSlotGame::onDoCollect {0}", ex);
            }
        }
        
        protected async Task OnDoGamble(string strUserID, int websiteID, GITMessage message, double balance, string sessionKey, string messageId)
        {
            try
            {
                string strGlobalUserID = string.Format("{0}_{1}", websiteID, strUserID);

                if (!_dicUserBetInfos.ContainsKey(strGlobalUserID) || !_dicUserResultInfos.ContainsKey(strGlobalUserID))
                {
                    _logger.Error("Can't gamble without betInfo and spinResult in BaseEGTSlotGame::onGambleHalf");
                    return;
                }

                BaseClasses.BaseEGTSlotBetInfo betInfo = _dicUserBetInfos[strGlobalUserID];
                BaseClasses.BaseEGTSlotSpinResult spinResult = _dicUserResultInfos[strGlobalUserID];

                betInfo.GambleHalf = true;
                betInfo.GambleType = int.Parse(message.Pop().ToString());

                if (betInfo.GambleType != 0 && betInfo.GambleType != 1)
                {
                    _logger.Error("Gamble index is failed in BaseEGTSlotGame::onGamblePick");
                    return;
                }

                ++betInfo.GambleRound;

                await GambleGame(strUserID, websiteID, balance, sessionKey, messageId);
            }
            catch (Exception ex)
            {
                _logger.Error("Exception has been occurred in BaseEGTSlotGame::onGambleHalf {0}", ex);
            }
        }

