        protected virtual void ChangeSpinString(JToken spinResponse, BaseClasses.BaseEGTSlotBetInfo betInfo)
        {
            // Apply Muliplier to all winAmount of spinResponse

            if (spinResponse.Type == JTokenType.Object)
            {
                foreach (var prop in spinResponse.Children<JProperty>())
                {
                    if (prop.Name == "winAmount" && prop.Value.Type == JTokenType.Integer)
                    {
                        int original = prop.Value.Value<int>();
                        prop.Value = original * betInfo.PlayBet / _spinDataDefaultBet;
                    }
                    else if (prop.Name == "winAmount" && prop.Value.Type == JTokenType.Float)
                    {
                        double original = prop.Value.Value<double>();
                        prop.Value = original * betInfo.PlayBet / _spinDataDefaultBet;
                    }
                    else
                    {
                        ChangeSpinString(prop.Value, betInfo);
                    }
                }
            }
            else if (spinResponse.Type == JTokenType.Array)
            {
                foreach (var child in spinResponse.Children())
                {
                    ChangeSpinString(child, betInfo);
                }
            }
        }
        
        protected virtual string BuildSpinResMsgString(string strGlobalUserID, double balance, double totalWin, double collectWin, BaseClasses.BaseEGTSlotBetInfo betInfo, string spinString, EGTMessageType type, string sessionKey, string messageId)
        {
            JObject originSpinData = JObject.Parse(spinString);
            JObject spinResponse = new JObject
            {
                { "complex", originSpinData["complex"] },
                { "state", originSpinData["state"]?.ToString()??"" },
                { "winAmount", int.Parse(originSpinData["winAmount"]?.ToString()??"") },
                { "sessionKey", sessionKey },
                { "msg", "success" },
                { "gameIdentificationNumber", GameIdentificationNumber },
                { "gameNumber",  CreateRoundID() },
                { "messageId", messageId },
                { "qName", "app.services.messages.response.GameEventResponse" },
                { "command", "bet" },
                { "eventTimestamp", DateTimeOffset.UtcNow.ToUnixTimeMilliseconds() }
            };

            if ((spinResponse["state"]?.ToString() ?? "") != "freespin")
            {
                spinResponse["state"] = CheckGamblePossible(totalWin, betInfo.PlayBet, betInfo) ? "gamble" : "idle";
                if (!CheckGamblePossible(totalWin, betInfo.PlayBet, betInfo))
                {
                    spinResponse["pendingWinResult"] = originSpinData["pendingWinResult"];
                    spinResponse["balance"] = balance;
                    if (totalWin > 0)
                        spinResponse["balance"] = balance + totalWin;
                }
                if (spinResponse["complex"] != null && spinResponse["complex"].Type == JTokenType.Object)
                {
                    var complex = (JObject)spinResponse["complex"];
                    complex["gambles"] = CheckGamblePossible(totalWin, betInfo.PlayBet, betInfo) ? 3 - betInfo.GambleRound : 0;
                }
            }
            else
            {
                if (spinResponse["complex"] != null && spinResponse["complex"].Type == JTokenType.Object)
                {
                    var complex = (JObject)spinResponse["complex"];
                    betInfo.FreespinTotalRound += (int)complex["freespins"];
                    if (complex["cascades"] != null && complex["cascades"].Type == JTokenType.Array)
                    {
                        var cascades = complex["cascades"] as JArray;
                        betInfo.FreespinTotalRound += cascades
                                                .Select(c => (int?)c["freespins"] ?? 0)
                                                .Sum();
                    }
                    if (complex["isRespinTriggered"] != null && bool.TryParse(complex["isRespinTriggered"]?.ToString(), out bool isTriggered) && isTriggered)
                    {
                        var respins = complex["triggeredRespins"] as JArray;
                        if (respins != null && respins.Type == JTokenType.Array)
                        {
                            int totalRespins = respins.Select(r => (int?)r ?? 0).Sum();
                            betInfo.FreespinTotalRound += totalRespins;
                        }
                    }
                }
            }
            ChangeSpinString(spinResponse, betInfo);

            return spinResponse.ToString();
        }

        protected virtual int GetSpinWinMoney(string strSpinData, BaseClasses.BaseEGTSlotBetInfo betInfo, bool isFreespin = false)
        {
            int totalWin = (int)((double)int.Parse(JObject.Parse(strSpinData)["winAmount"]?.ToString() ?? "") * ((double)betInfo.PlayBet / (double)_spinDataDefaultBet));
            return totalWin;
        }
        protected virtual string BuildCollectResMsgString(string strGlobalUserID, double balance, BaseClasses.BaseEGTSlotBetInfo betInfo, BaseClasses.BaseEGTSlotSpinResult spinResult, EGTMessageType type, string sessionKey, string messageId)
        {
            JObject collectResponse = JObject.Parse(CollectResponseString);
            collectResponse["winAmount"] = spinResult.TotalWin;
            collectResponse["balance"] = balance;
            collectResponse["gameNumber"] = betInfo.RoundID;
            collectResponse["sessionKey"] = sessionKey;
            collectResponse["messageId"] = messageId;
            collectResponse["eventTimestamp"] = DateTimeOffset.UtcNow.ToUnixTimeMilliseconds();

            return collectResponse.ToString();
        }
        protected virtual string BuildGambleResultResMsgString(string strGlobalUserID, double balance, int cardSymbol, BaseClasses.BaseEGTSlotBetInfo betInfo, BaseClasses.BaseEGTSlotSpinResult spinResult, EGTMessageType type, string sessionKey, string messageId)
        {
            JObject gambleResponse = JObject.Parse(GambleResponseString);
            if (gambleResponse["complex"] != null && gambleResponse["complex"].Type == JTokenType.Object)
            {
                var complex = (JObject)gambleResponse["complex"];
                complex["gambles"] = (CheckGamblePossible(spinResult.TotalWin, betInfo.PlayBet, betInfo) && betInfo.GambleRound < 3) ? 3 - betInfo.GambleRound : 0;
                complex["card"] = cardSymbol;
            }
            gambleResponse["winAmount"] = spinResult.TotalWin;
            gambleResponse["state"] = (CheckGamblePossible(spinResult.TotalWin, betInfo.PlayBet, betInfo) && betInfo.GambleRound < 3) ? "gamble" : "idle";
            if (!(CheckGamblePossible(spinResult.TotalWin, betInfo.PlayBet, betInfo) && betInfo.GambleRound < 3))
            {
                gambleResponse["balance"] = balance + spinResult.TotalWin;
                gambleResponse["pendingWinResult"] = new JObject
                {
                    ["overflowAmount"] = 0,
                    ["mysteryAmount"] = 0,
                    ["totalRemainingOverflowAmount"] = 0
                };
            }
            gambleResponse["gameNumber"] = betInfo.RoundID;
            gambleResponse["sessionKey"] = sessionKey;
            gambleResponse["messageId"] = messageId;
            gambleResponse["eventTimestamp"] = DateTimeOffset.UtcNow.ToUnixTimeMilliseconds();

            return gambleResponse.ToString();
        }
        protected virtual BaseClasses.BaseEGTSlotSpinResult CalculateResult(BaseClasses.BaseEGTSlotBetInfo betInfo, BaseClasses.BaseEGTSlotSpinResult lastResult, string strGlobalUserID, string strSpinResponse, bool isFirst, double userBalance, double betMoney, double spinOdd, string sessionKey, string messageId)
        {
            try
            {
                BaseClasses.BaseEGTSlotSpinResult spinResult = new BaseClasses.BaseEGTSlotSpinResult();
                spinResult.TotalWin = GetSpinWinMoney(strSpinResponse, betInfo);
                spinResult.ResultString = BuildSpinResMsgString(strGlobalUserID, userBalance, spinResult.TotalWin, spinResult.CollectWin, betInfo, strSpinResponse, isFirst ? EGTMessageType.NormalSpin : EGTMessageType.FreeSpin, sessionKey, messageId);
                spinResult.FirstSpinString = spinResult.ResultString;
                spinResult.Action = EGTMessageType.NormalSpin;
                return spinResult;
            }
            catch (Exception ex)
            {
                _logger.Error("Exception has been occurred in BaseEGTSlotGame::calculateResult {0}", ex);
                return null;
            }
        }
        protected virtual List<BaseClasses.BaseEGTActionToResponse> BuildResponseList(List<string> responseList)
        {
            List<BaseClasses.BaseEGTActionToResponse> actionResponseList = new List<BaseClasses.BaseEGTActionToResponse>();
            for (int i = 1; i < responseList.Count; i++)
            {
                EGTMessageType action = ConvertRespMsgCodeToAction((long)EGTMessageType.FreeSpin);

                actionResponseList.Add(new BaseClasses.BaseEGTActionToResponse(action, responseList[i]));
            }
            return actionResponseList;
        }

