        protected virtual async Task<BaseClasses.BaseEGTSlotSpinResult> GenerateSpinResult(BaseClasses.BaseEGTSlotBetInfo betInfo, BaseClasses.BaseEGTSlotSpinResult lastResult, string strUserID, int websiteID, double userBalance, double betMoney, bool usePayLimit, string sessionKey, string messageId)
        {
            BasePPSlotSpinData spinData = null;
            BaseClasses.BaseEGTSlotSpinResult result = null;

            string strGlobalUserID = string.Format("{0}_{1}", websiteID, strUserID);
            if (betInfo.HasRemainResponse)
            {
                BaseClasses.BaseEGTActionToResponse nextResponse = betInfo.pullRemainResponse();
                result = CalculateResult(betInfo, lastResult, strGlobalUserID, nextResponse.Response, false, userBalance, betInfo.PlayBet, 0, sessionKey, messageId);
                betInfo.SpinInfo = nextResponse.Response;
                ++betInfo.FreespinRoundUsed;

                if (!betInfo.HasRemainResponse)
                    betInfo.RemainReponses = null;
                return result;
            }
            ++TestNumber;
            double realBetMoney = betInfo.PlayBet;

            spinData = await SelectRandomStop(websiteID, realBetMoney, betInfo);

            // test code
            //if (TestNumber % 3 == 0)
            //{
            //    if (spinData.SpinStrings.Count > 1)
            //    {
            //        result = CalculateResult(betInfo, lastResult, strGlobalUserID, spinData.SpinStrings[0], true, userBalance, betMoney, spinData.SpinOdd, sessionKey, messageId);
            //        betInfo.RemainReponses = BuildResponseList(spinData.SpinStrings);
            //        betInfo.SpinInfo = spinData.SpinStrings[0];
            //        return result;
            //    }
            //}
            // end test code

            double totalWin = 0;
            if (spinData.SpinOdd > 0)
                totalWin = (int)realBetMoney * spinData.SpinOdd;
            
            if (!usePayLimit || await CheckWebsitePayoutRate(websiteID, realBetMoney, totalWin))
            {
                do
                {
                    result = CalculateResult(betInfo, lastResult, strGlobalUserID, spinData.SpinStrings[0], true, userBalance, betMoney, spinData.SpinOdd, sessionKey, messageId);
                    if (spinData.SpinStrings.Count > 1)
                        betInfo.RemainReponses = BuildResponseList(spinData.SpinStrings);
                    betInfo.SpinInfo = spinData.SpinStrings[0];
                    return result;
                } while (false);
            }

            spinData = await SelectEmptySpin(betInfo);
            result = CalculateResult(betInfo, lastResult, strGlobalUserID, spinData.SpinStrings[0], true, userBalance, betMoney, spinData.SpinOdd, sessionKey, messageId);
            
            SumUpWebsiteBetWin(websiteID, realBetMoney, 0.0);
            betInfo.SpinInfo = spinData.SpinStrings[0];
            return result;
        }
        protected byte[] BackupBetInfo(BaseEGTSlotBetInfo betInfo)
        {
            using (MemoryStream ms = new MemoryStream())
            {
                using (BinaryWriter writer = new BinaryWriter(ms))
                {
                    betInfo.SerializeTo(writer);
                }
                return ms.ToArray();
            }
        }
        protected virtual async Task SpinGame(string strUserID, int websiteID, double userBalance, bool isNewBet, string sessionKey, string messageId)
        {
            try
            {
                string strGlobalUserID = string.Format("{0}_{1}", websiteID, strUserID);

                BaseClasses.BaseEGTSlotBetInfo betInfo = null;
                if (!_dicUserBetInfos.TryGetValue(strGlobalUserID, out betInfo))
                    return;

                BaseClasses.BaseEGTSlotSpinResult lastResult = null;
                if (_dicUserResultInfos.ContainsKey(strGlobalUserID))
                    lastResult = _dicUserResultInfos[strGlobalUserID];

                double betMoney = betInfo.PlayBet;

                UserBetTypes betType = UserBetTypes.Normal;
                
                if (betInfo.HasRemainResponse || betInfo.GambleType > 0 || betInfo.GambleHalf)
                    betMoney = 0.0;

                if (userBalance.LT(betMoney, _epsilion) || betMoney < 0.0)
                {
                    GITMessage message = new GITMessage((ushort)SCMSG_CODE.SC_EGT_DOSPIN);
                    message.Append("-1User balance is less that bet money");
                    ToUserMessage toUserResult = new ToUserMessage((int)_gameID, message);
                    Sender.Tell(toUserResult, Self);
                    _logger.Error("user balance is less than bet money in BaseEGTSlotGame::spinGame {0} balance:{1}, bet money: {2} game id:{3}",
                        strGlobalUserID, userBalance, betMoney, _gameID);
                    return;
                }

                if (isNewBet)
                {
                    betInfo.BetTransactionID = CreateTransactionID();
                    betInfo.RoundID = CreateRoundID();
                    betInfo.GambleRound = 0;
                    betInfo.FreespinRoundUsed = 0;
                    betInfo.FreespinTotalRound = 0;
                }
                userBalance -= betMoney;

                BaseClasses.BaseEGTSlotSpinResult spinResult = await GenerateSpinResult(betInfo, lastResult, strUserID, websiteID, userBalance, betMoney, true, sessionKey, messageId);

                string strGameLog = spinResult.ResultString;
                _dicUserResultInfos[strGlobalUserID] = spinResult;

                JackpotPoolConfig.Instance.PoolActor.Tell(new SumUpWebsiteJackpotRequest(websiteID, _gameID, betMoney));

                saveBetResultInfo(strGlobalUserID);

                bool isAutoCollect = !betInfo.HasRemainResponse && spinResult.TotalWin > 0 && !CheckGamblePossible(spinResult.TotalWin, betInfo.PlayBet, betInfo);
                SendGameResult(betInfo, spinResult, strGlobalUserID, betMoney, isAutoCollect ? spinResult.TotalWin : 0.0, strGameLog, isAutoCollect ? userBalance + spinResult.TotalWin : userBalance, betType);

                _dicUserLastBackupResultInfos[strGlobalUserID] = lastResult;
            }
            catch (Exception ex)
            {
                _logger.Error("Exception has been occurred in BaseEGTSlotGame::spinGame {0}", ex);
            }
        }
        protected virtual async Task GambleGame(string strUserID, int websiteID, double userbalance, string sessionKey, string messageId)
        {
            string strGlobalUserID = string.Format("{0}_{1}", websiteID, strUserID);

            BaseClasses.BaseEGTSlotBetInfo betInfo = _dicUserBetInfos[strGlobalUserID];
            BaseClasses.BaseEGTSlotSpinResult lastResult = _dicUserResultInfos[strGlobalUserID];
            string strSpinResponse = lastResult.ResultString;

            int cardSymbol = await SelectCardSymbol(websiteID, betInfo, lastResult);

            int winMultiple = 0;
            if (betInfo.GambleType == (int)GambleTypes.Red && (cardSymbol == (int)CardTypes.Diamond || cardSymbol == (int)CardTypes.Heart))
                winMultiple = 2;
            else if (betInfo.GambleType == (int)GambleTypes.Black && (cardSymbol == (int)CardTypes.Club || cardSymbol == (int)CardTypes.Spade))
                winMultiple = 2;

            betInfo.GambleCardHistory.Add(cardSymbol);

            if(lastResult.CollectWin > 0)
            {
                if (winMultiple == 0)
                    lastResult.CollectWin -= lastResult.TotalWin;
                if (winMultiple == 2)
                    lastResult.CollectWin += lastResult.TotalWin;
            }
            lastResult.TotalWin = (double)lastResult.TotalWin * winMultiple;
            lastResult.Action = EGTMessageType.GamblePick;

            strSpinResponse = BuildGambleResultResMsgString(strGlobalUserID, userbalance, cardSymbol, betInfo, lastResult, lastResult.Action, sessionKey, messageId);

            lastResult.ResultString = strSpinResponse;
            
            saveBetResultInfo(strGlobalUserID);
            _dicUserResultInfos[strGlobalUserID] = lastResult;
            SendGambleResult(lastResult, strGlobalUserID, 0.0, !(lastResult.TotalWin > 0 && betInfo.GambleRound < 3) ? lastResult.TotalWin: 0.0, "GamblePick", userbalance);
            _dicUserLastBackupResultInfos[strGlobalUserID] = lastResult;
        }
        private async Task<int> SelectCardSymbol(int websiteID, BaseClasses.BaseEGTSlotBetInfo betInfo, BaseClasses.BaseEGTSlotSpinResult lastResult)
        {
            int cardSymbol = (int)CardTypes.Diamond;

            double payoutRate = GetPayoutRate(websiteID);
            double randomDouble = Pcg.Default.NextDouble(0.0, 100.0);

            if (randomDouble >= payoutRate || payoutRate == 0.0)
            {
                if (betInfo.GambleType == (int)GambleTypes.Red)
                {
                    List<int> noRedSymbol = new List<int>() { (int)CardTypes.Club, (int)CardTypes.Spade };
                    cardSymbol = noRedSymbol[Pcg.Default.Next(0, 2)];
                }
                else if (betInfo.GambleType == (int)GambleTypes.Black)
                {
                    List<int> noBlackSymbol = new List<int>() { (int)CardTypes.Diamond, (int)CardTypes.Heart };
                    cardSymbol = noBlackSymbol[Pcg.Default.Next(0, 2)];
                }
            }
            else
            {
                if (!await CheckWebsitePayoutRate(websiteID, lastResult.TotalWin, lastResult.TotalWin * 2, 0))
                {
                    if (betInfo.GambleType == (int)GambleTypes.Red)
                    {
                        List<int> noRedSymbol = new List<int>() { (int)CardTypes.Club, (int)CardTypes.Spade };
                        cardSymbol = noRedSymbol[Pcg.Default.Next(0, 2)];
                    }
                    else if (betInfo.GambleType == (int)GambleTypes.Black)
                    {
                        List<int> noBlackSymbol = new List<int>() { (int)CardTypes.Diamond, (int)CardTypes.Heart };
                        cardSymbol = noBlackSymbol[Pcg.Default.Next(0, 2)];
                    }
                }
                else 
                {
                    cardSymbol = Pcg.Default.Next(0, 4);
                
                    if (betInfo.GambleType == (int)GambleTypes.Red && (cardSymbol != (int)CardTypes.Diamond && cardSymbol != (int)CardTypes.Heart))
                        SumUpWebsiteBetWin(websiteID, 0, -lastResult.TotalWin * 2, 0);
                    else if (betInfo.GambleType == (int)GambleTypes.Black && (cardSymbol != (int)CardTypes.Club && cardSymbol != (int)CardTypes.Spade))
                        SumUpWebsiteBetWin(websiteID, 0, -lastResult.TotalWin * 2, 0);
                }
            }

            return cardSymbol;
        }
        protected virtual void SendGameResult(BaseClasses.BaseEGTSlotBetInfo betInfo, BaseClasses.BaseEGTSlotSpinResult spinResult, string strGlobalUserID, double betMoney, double winMoney, string strGameLog, double userBalance, UserBetTypes betType)
        {
            GITMessage message = new GITMessage((ushort)SCMSG_CODE.SC_EGT_DOSPIN);
            message.Append(spinResult.ResultString);
            ToUserResultMessage toUserResult = new ToUserResultMessage((int)_gameID, message, betMoney, winMoney, new GameLogInfo(GameName, "0", strGameLog), UserBetTypes.Normal);

            toUserResult.BetTransactionID = betInfo.BetTransactionID;
            toUserResult.RoundID = betInfo.RoundID;

            if (!betInfo.HasRemainResponse && (spinResult.TotalWin == 0 || spinResult.TotalWin > 0 && !CheckGamblePossible(spinResult.TotalWin, betInfo.PlayBet, betInfo)))
            {
                toUserResult.TransactionID = CreateTransactionID();
                toUserResult.RoundEnd = true;
            }

            Sender.Tell(toUserResult, Self);
        }
        protected virtual void SendGambleResult(BaseClasses.BaseEGTSlotSpinResult spinResult, string strGlobalUserID, double betMoney, double winMoney, string strGameLog, double userBalance)
        {
            BaseClasses.BaseEGTSlotBetInfo betInfo = _dicUserBetInfos[strGlobalUserID];
            GITMessage message = new GITMessage((ushort)SCMSG_CODE.SC_EGT_DOGAMBLE);
            message.Append(spinResult.ResultString);

            ToUserResultMessage toUserResult = new ToUserResultMessage((int)_gameID, message, betMoney, winMoney, new GameLogInfo(GameName, "0", strGameLog), UserBetTypes.Normal);
            toUserResult.BetTransactionID = betInfo.BetTransactionID;
            toUserResult.RoundID = betInfo.RoundID;
            toUserResult.TransactionID = CreateTransactionID();
            toUserResult.RoundEnd = false;
            if(!(spinResult.TotalWin > 0 && betInfo.GambleRound < 3))
                toUserResult.RoundEnd = true;

            saveBetResultInfo(strGlobalUserID);
            Sender.Tell(toUserResult, Self);
        }

